import React from "react";
import { Element } from "react-scroll";
import "./VissionMissionContainer.css";

const VissionMissionContainer = (props) => {
  let metadata = props.metadata;

  // const vissions = metadata.vission.map((item) => <li>{item}</li>);

  return (
    <Element name="Mission" className="missioncontainer">
      <div>
        <h1 className="Title">
          <bold>Mission</bold>
        </h1>
        <div className="container">
          <div className="row d-flex justify-content-center">
            <div className="col-md-11">
              <ul>
                {metadata.mission.map((item, index) => {
                  return (
                    <ul>
                      <li>{item.Mission1}</li>
                      <li>{item.Mission2}</li>
                      <li>{item.Mission1}</li>
                    </ul>
                  );
                })}
              </ul>
            </div>
          </div>
        </div>
      </div>
      <div>
        <h1>
          <bold>Vission</bold>
        </h1>
        <div className="container">
          <div className="row d-flex justify-content-center">
            <div className="col-md-11">
              <p>{metadata.vission}</p>
            </div>
          </div>
        </div>
      </div>
    </Element>
  );
};

export default VissionMissionContainer;
